import React from 'react'

class Header extends React.Component{
    render(){
        return (
            <nav class="navbar">
                <div class="navbar-start">
                    <a class="navbar-item" href="https://bulma.io">
                        Home
                    </a>
                </div>
            </nav>
        );
    }
}

export default Header;
